import React, { useEffect } from "react";

export default function Read({users}){
    const afficher=()=>{
        console.log("hhhh", users);
    }
    useEffect(() => {
        
        return () => {
            afficher()
        };
    }, [afficher()]);
  return(
    <>
    <h1>hellow read</h1>
    <table class="table">
        <thead>
            <tr>
                <th>id</th>
                <th>fullname</th>
                <th>country</th>
            </tr>
        </thead>
        <tbody> {users.length > 0 ? ( users.map((user, key) => ( <tr key={key}> <td>{user.id}</td> <td>{user.fullname}</td> <td>{user.country}</td> </tr> )) ) : ( <tr> <td colSpan="3">Aucun utilisateur</td> </tr> )} </tbody>
    </table>
    </>
  )
};
